import axios from 'axios';
import { useEffect, useState } from "react";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { GoogleMap, LoadScript } from "@react-google-maps/api";
import $ from 'jquery';
import Swal from "sweetalert2";

const containerStyle = {
    width: '100%',
    height: '80vh'
};

const HomePage = () => {
    const [locTypes, setLocTypes] = useState([]);

    const center = {
        lat : 35.118620223842,
        lng : 129.0959130382
    }
    const url = "http://travelbusanko.com";
    useEffect(() => {
        axios.get(url + "/api/location/types", {
            headers: {
                "Content-Type": `application/json`,
            }
        }).then((res) => {
            setLocTypes([...res.data]);
            
        })
    }, []);
    return (
        
        <Container>
        <Row>
          <Col>
            <LoadScript googleMapsApiKey="AIzaSyB-RafIQqKjj2kactuwVHkuoulZSKA4rSs">
              <GoogleMap
                bootstrapURLKeys={{key:"AIzaSyB-RafIQqKjj2kactuwVHkuoulZSKA4rSs"}}
                mapContainerStyle={containerStyle}
                center={center}
                zoom={14}
              >
              </GoogleMap>
            </LoadScript>
          </Col>
          <Col>
          <Figure className="image__viewer m-3">

          </Figure>
            {/* <div className="image__viewer m-3">
            
            </div> */}
          </Col>
        </Row>
      </Container>
    );
};

export default HomePage;
